import React, { Component } from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { Route } from 'react-router';
import './App.css';
import apps from './apps';
import { Nav, Navbar } from 'react-bootstrap';

class Main extends Component {
  render(){
    return (
      <Navbar bg="dark" expand="lg" variant="dark">
        <Navbar.Brand href="#home">NF CMS</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#comopany">Company</Nav.Link>
            <Nav.Link href="#employee">Company</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

function App() {
  const routeList = Object.keys(apps.services).map(route => {
    return <Route path={ `/${route}` } component={ apps.services[route] } key={ route }/>;
  })

  return (
    <div className="App">
      <Router>
        <Route path="/" component={ Main }/>
        { routeList }
      </Router>
    </div>
  );
}

export default App;
